import React, { Component } from 'react';
import Sidemenu from "./sidemenu.js";
import Dash from "./dash.js"
import "../view.css"
export default class Dashboard extends Component {
    constructor(props) {
        //create state
        super(props);
        this.state = {
            
        };
    }
    

    render() {
       

        return (
            <div style={{display:"flex", flexDirection:"row", justifycontent:"space-between"}}>
                <div className="sidemenu">
                <Sidemenu handleChange={this.props.handleChange} statesetter={this.props.statesetter}/>
                </div>
                
                

            </div>
        );
    }
}

function Switchcase (props) {
    switch(props){
        case props.student:
            return <Student handleChange={props.handleChange} statesetter={props.statesetter} props={props.state}/>
            case props.metro:
                return <Metro />
                case props.calendar:
                return <Calendar />
                case props.studentlist:
                    return <Studentlist />
        default:
            return <Dash handleChange={props.handleChange} statesetter={props.statesetter} props={props.state}/>
    }
   
}
